import Navbar from './Components/Navbar';
import React, { Component } from 'react';
import News from './Components/News';
import { BrowserRouter as Router, Routes, Route } from 'react-router-dom';
import LoadingBar from 'react-top-loading-bar';
export class App extends Component {
  state = {
    progress: 0,
  };

  setProgress(progress) {
    this.setState({ progress: progress });
  }
  render() {
    return (
      <Router>
        <Navbar />

        <LoadingBar color='#f11946' progress={this.state.progress} height={5} />

        <Routes>
          <Route
            exact
            path='/'
            element={
              <News
                setProgress={setProgress}
                key={'general'}
                pageSize={6}
                country='in'
                category='general'
              />
            }
          />
          <Route
            exact
            path='/business'
            element={
              <News
                setProgress={setProgress}
                key={'business'}
                pageSize={6}
                country='in'
                category='business'
              />
            }
          />
          <Route
            exact
            path='/entertainment'
            element={
              <News
                setProgress={setProgress}
                key={'entertainment'}
                pageSize={6}
                country='in'
                category='entertainment'
              />
            }
          />
          <Route
            exact
            path='/health'
            element={
              <News
                setProgress={setProgress}
                key={'health'}
                pageSize={6}
                country='in'
                category='health'
              />
            }
          />
          <Route
            exact
            path='/science'
            element={
              <News
                setProgress={setProgress}
                key={'science'}
                pageSize={6}
                country='in'
                category='science'
              />
            }
          />
          <Route
            exact
            path='/sports'
            element={
              <News
                setProgress={setProgress}
                key={'sports'}
                pageSize={6}
                country='in'
                category='sports'
              />
            }
          />
          <Route
            exact
            path='/technology'
            element={
              <News
                setProgress={setProgress}
                key={'technology'}
                pageSize={6}
                country='in'
                category='technology'
              />
            }
          />
        </Routes>
      </Router>
    );
  }
}

export default App;
